const ReviewsCard = () => {

    return(
        <div className="reviews-card-container">
            <div className="reviews-card-image">
                <img src="/AllanStevens.png" alt=""/>
            </div>
            <div className="reviews-card-name">
                <h3>Allan Stevens</h3>
            </div>
            
        </div>
    )
}

export default ReviewsCard
